import MobileNavigation from "./MobileNavigation";
import Navigation from "./Navigation";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="Navbar">
        <MobileNavigation/>
        <Navigation/>
      </div>
    </div>
  );
}

export default App;
